$(document).ready(function() {
        const track = $('.carousel-track');
        const cardWidth = $('.custom-product-card').outerWidth(true); // Ancho de cada tarjeta con margen
        const totalCards = $('.custom-product-card').length;
        const visibleCards = Math.floor($('.carousel-container').width() / cardWidth);
        let currentPosition = 0;

        $('.carousel-arrow.right').click(function() {
            if (currentPosition < totalCards - visibleCards) {
                currentPosition++;
                track.css('transform', `translateX(-${cardWidth * currentPosition}px)`);
            }
        });

        $('.carousel-arrow.left').click(function() {
            if (currentPosition > 0) {
                currentPosition--;
                track.css('transform', `translateX(-${cardWidth * currentPosition}px)`);
            }
        });
    });
//

